import React from "react";
import { AppBar, Toolbar, Typography } from "@mui/material";

const Header = ({ logo }) => {
  return (
    <AppBar
      position="fixed"
      sx={{ top: 0, backgroundColor: "#313131", width: "100%" }}
    >
      <Toolbar>
        <img src={logo} alt="logo" height={40} width={60} />
        <Typography variant="h5" sx={{ width: "100%", color: "#EC625F", fontFamily: "Ru" }}>
          AlienGPT
        </Typography>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
